import React from 'react';


class VRModel extends React.Component {
   render() {
      return (
         <div>


    <model-viewer src="Images/scene.gltf" auto-rotate camera-controls background-color="#455A64"></model-viewer>

         </div>
      );
   }
}
export default VRModel;
